About 4MLinux.

4MLinux is a mini Linux distro focusing on the following &quot;4M&quot;:
 Maintenance (system rescue Live CD),
 Multimedia (e.g., playing video DVDs),
 Miniserver (using the inetd daemon),
 Mystery (console games).

2011-08-11
4MLinux-2.3-game-edition released.

All 4MLinux applications have been compiled under Slackware 13.1 (x86/32-bit/SMP):
kernel 2.6.39.2,
glibc 2.11.1,
gcc 4.4.4.

Have a nice Linux !
Zbigniew Konojacki
